import React from 'react';

export default class UseLocalStorage extends React.Component {
    constructor() {
        super(0);
        this.state = {
            date: ''
        }
        const [date, setDate] = React.useState('');
    }

    setData(dateValue: Date): void {
        // localStorage.setItem('patients', )
        // return date.toString();
        // this.setState({date: dateValue.toString});
        this.setData(dateValue);
    }

    getData(): string {
        return this.state.date;
    }

    getGender(gender: string): string {
        return gender;
    }

    getAge(): number {
        return 50;
    }
}
